    JSONObject jsonObject = new JSONObject();
    try {
        jsonObject.put("player_id", player);
        jsonObject.put("event_type", "initialize");
    } catch (JSONException e) {
        e.printStackTrace();
    }
    socket.emit("initialize", jsonObject.toString());
